import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "../pages/mypage/Login";
import Main from "../pages/main/Main";
import MenuBar from "./MenuBar";
import Logout from "../pages/mypage/Logout";
import StorageList from "../pages/storage/StorageList";
import DetaileStorage from "../pages/storage/DetaileStorage";

const AppRouter = ({ isLoggedIn }) => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/"
               element={isLoggedIn ? <Main /> : <Login />} />
      </Routes>
      <Routes>
        <Route path='/logout' element={<Logout/>}></Route>
        <Route path='/storagelist' element={<StorageList />}></Route>
        {/*path='/detail/:storageName*/}
        <Route path='/detail/:storageName' element={<DetaileStorage />}></Route>
      </Routes>
      {isLoggedIn && <MenuBar />}
    </BrowserRouter>
  );
};

export default AppRouter;
